      out.write("function updatePrice(totalpriceid,priceid,subtotalpriceid,vrefid,minprice,igst){\n");
      out.write("	var price=$(\"#\"+priceid).val();\n");
      out.write("	var gstPrice=Math.ceil((Number(price)*Number(igst))/100);\n");
      out.write("	if(Number(price)>=Number(minprice)){\n");
      out.write("	showLoader();\n");
      out.write("	$.ajax({\n");
      out.write("		type : \"POST\",\n");
      out.write("		url : \"UpdatePriceOfProduct111\",\n");
      out.write("		dataType : \"HTML\",\n");
      out.write("		data : {\n");
      out.write("			price : price,\n");
      out.write("			vrefid : vrefid,\n");
      out.write("			\"pricerefid\" : subtotalpriceid\n");
      out.write("			},\n");
      out.write("		success : function(data){\n");
      out.write("			var x=data.split(\"#\");\n");
      out.write("			if(x[0]==\"pass\"){\n");
      out.write("				document.getElementById(\"errorMsg1\").innerHTML=\"Updated.\";\n");
      out.write("				$(\"#\"+totalpriceid).val(Math.ceil(Number(price)+Number(gstPrice)));				\n");
      out.write("				$(\"#\"+subtotalpriceid).val(Math.ceil(Number(x[1])));	\n");
      out.write("				$(\"#\"+subtotalpriceid+\"1\").val(Math.ceil(Number(x[2])));\n");
      out.write("			$('.alert-show1').show().delay(3000).fadeOut();\n");
      out.write("			}else{\n");
      out.write("				document.getElementById(\"errorMsg\").innerHTML=\"Something Went Wrong, Try After Sometime later.\";				\n");
      out.write("				$('.alert-show').show().delay(4000).fadeOut();\n");
      out.write("			}\n");
      out.write("			\n");
      out.write("		},\n");
      out.write("		complete : function(data){\n");
      out.write("			hideLoader();\n");
      out.write("		}\n");
      out.write("	});\n");
      out.write("	}else{\n");
      out.write("		document.getElementById(\"errorMsg\").innerHTML=\"Not Permission to reduce price, You may only increase price !!\";		\n");
      out.write("		$(\"#\"+priceid).val(minprice);\n");
      out.write("		$('.alert-show').show().delay(4000).fadeOut();\n");
      out.write("	}\n");
      out.write("}\n");
